user_pref("lightweightThemes.usedThemes", "[{\"id\":\"2635\",\"name\":\"Mozilla Firefox\",\"headerURL\":\"http://getpersonas-cdn.mozilla.net/static/3/5/2635/firefox_header.jpg?1260925626\",\"footerURL\":\"http://getpersonas-cdn.mozilla.net/static/3/5/2635/firefox_footer.jpg?1260925626\",\"textcolor\":\"#ffffff\",\"accentcolor\":\"#ffffff\",\"iconURL\":\"http://getpersonas-cdn.mozilla.net/static/3/5/2635/preview_small.jpg?1260925626\",\"previewURL\":\"http://getpersonas-cdn.mozilla.net/static/3/5/2635/preview.jpg?1260925626\",\"author\":\"CoreXE\",\"description\":\"Just a Firefox Persona. :D\",\"updateURL\":\"https://www.getpersonas.com/en-US/update_check/2635\",\"version\":\"1260925626\"},{\"id\":\"31209\",\"name\":\"Bubble Bay by David Lanham\",\"accentcolor\":\"#6fb8e6\",\"textcolor\":\"#000000\",\"description\":\"David Lanham\\u0019s day job is working at the Iconfactory creating computer icons like Amora for OSX which was inspired by Chris Cunningham\\u0019s android-esque music video for Björk. But even in his downtime he can\\u0019t stop creating art: when he heads home in the evening he creates pieces of artwork that look as if they have been culled straight out of his own manga movie. David also has a character called Zog who has been made into a vinyl toy by StrangeKiss.\",\"author\":\"Infectious\",\"headerURL\":\"http://getpersonas-cdn.mozilla.net/static/0/9/31209/persona_DavidLanham_header_revised.png?1260925626\",\"footerURL\":\"http://getpersonas-cdn.mozilla.net/static/0/9/31209/persona_DavidLanham_footer_revised.png?1260925626\",\"previewURL\":\"http://getpersonas-cdn.mozilla.net/static/0/9/31209/preview.jpg?1260925626\",\"iconURL\":\"http://getpersonas-cdn.mozilla.net/static/0/9/31209/preview_small.jpg?1260925626\",\"updateURL\":\"https://www.getpersonas.com/en-US/update_check/31209\"},{\"id\":\"30987\",\"name\":\"Endless Possibilities by Etsu\",\"accentcolor\":\"#ffffff\",\"textcolor\":\"#000000\",\"description\":\"Etsu Meusy\\u0019s work has been described as \\u001csunny and clean\\u001d by Giant Robot and \\u001cnostalgia-tinged 70s and 80s pop cultural pastiches\\u001d by Coolhunting. Etsu blends together paint, hand drawn typography and the odd guest appearance from 80s icons like Axl Rose and the Smurfs to create dreamy rainbow colored landscapes. Her artwork has been featured in Nylon magazine and art books by Die Gestalten.\",\"author\":\"Infectious\",\"headerURL\":\"http://getpersonas-cdn.mozilla.net/static/8/7/30987/etsu_v2_header.jpg?1260925626\",\"footerURL\":\"http://getpersonas-cdn.mozilla.net/static/8/7/30987/etsu_v2_footer.jpg?1260925626\",\"previewURL\":\"http://getpersonas-cdn.mozilla.net/static/8/7/30987/preview.jpg?1260925626\",\"iconURL\":\"http://getpersonas-cdn.mozilla.net/static/8/7/30987/preview_small.jpg?1260925626\",\"updateURL\":\"https://www.getpersonas.com/en-US/update_check/30987\"},{\"id\":\"7610\",\"name\":\"Japanese Tattoo\",\"author\":\"enguyen\",\"headerURL\":\"http://getpersonas-cdn.mozilla.net/static/1/0/7610/personajpg.jpg?1260925626\",\"footerURL\":\"http://getpersonas-cdn.mozilla.net/static/1/0/7610/persona2jpg.jpg?1260925626\",\"previewURL\":\"http://getpersonas-cdn.mozilla.net/static/1/0/7610/preview.jpg?1260925626\",\"iconURL\":\"http://getpersonas-cdn.mozilla.net/static/1/0/7610/preview_small.jpg?1260925626\",\"accentcolor\":\"#000000\",\"textcolor\":\"#000000\",\"updateURL\":\"https://www.getpersonas.com/en-US/update_check/7610\",\"version\":\"1260925626\"}]");
